Step 1: Identify the cash available. We use the “Ending Balance” from the “Cash and Cash Equivalents” section of the cash flow statement. For this problem, the ending balance is 8,365,772.68.

Step 2: Identify the current liabilities (or current debt). From the balance sheet, the “Total Current Liabilities” amount is 1,548,001.20.

Step 3: Compute the Cash to Current Debt Ratio by dividing the cash available by the current liabilities.

Calculation:
  Cash to Current Debt Ratio = 8,365,772.68 / 1,548,001.20 ≈ 5.402

Step 4: Rounding to two decimal places gives approximately 5.40.

Thus, the solution is:

